形状記憶合金でおいしさを作りだし、<br>ステンレスポットが入れ立ての味と香りを長時間逃しません。<br>カリタ・ET550-TDはコーヒー本来の美味しさを長時間大切にしたい<br>喫茶店やオフィスコーヒーサービスに最適なマシン。業務用コーヒーマシンで0.7リットル以上のコーヒーを作るとき、抽出時間が長くなればなるほど、<br>様々な成分がコーヒーの中に多く出てしまい、風味を損ないがちです。<br><br>そこで抽出時間を短くするため、抽出弁に形状記憶合金を採用し、短時間抽出を実現。<br>コーヒー豆が持つ本来の美味しさだけを引き出します。<br><br>さらに、専用の液晶サーモデカンタ1.8リットルへダイレクトに抽出することで、<br>その美味しさを長時間保つようになりました。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>電源：100V/1<br>型式：ET-550TD<br><br>購入単位：1台<br>配送種別：<b>取寄品　<font color=#ff0000>返品不可　配送日時指定不可</font></b><br>　※商品は取寄品のため、ご希望配送日時の指定はできません。<br><br>納期：メーカーに在庫確認後配送いたします</p></td></tr></table></p></td></tr></table><img src=http://image.rakuten.co.jp/onestep/cabinet/parts/pix_henpin.gif><br><br>■多人数や繁忙時にも余裕の抽出能力。<br>最大12カップを約10分間隔で繰り返し抽出が可能。<br>複数の液晶サーモデカンタKTD-18を用意しておけば、手間も省けます。<br><br>■冷たくておいしいアイスコーヒーもOK♪<br>専用デカンターはステンレス製だから氷を直接入れて抽出可能。<br>クリアーなアイスコーヒーが手早くでき上がり、冷たさが長持ちします。<br><br>■使いやすさも安全設計も美味しさの秘密。<br>「つい、うっかり」を防ぐ空だき防止装置や給水口はゴミや虫などの侵入を防ぐ給水口フィルター付きです。<br>水位パネル付き。<br><br>■煮詰まらない♪　丈夫な液晶サーモデカンタ搭載。<br>直接抽出されたコーヒーが入るので、煮詰まり感のない、入れ立ての香りとコクが長時間楽しめます。<br>専用サーモデカンタ内を湯煎して温めておくと、より効果的です。<br><br>■チャコールグレーのシャープなデザイン。<br>あまり業務的すぎず、それでいてインテリアの邪魔にならないスッキリしたデザインが自慢です。<br>専用デカンタの液晶には残量と温度が表示され、一目で品質管理ができます。<br>常に飲み頃をキープして、無駄のないコーヒーサービスが可能になります。<br><br><br><font size=1 color=#000000>【検索用キーワード】<br>楽天 通販 食品飲料・産直グルメ コーヒー・シュガー・ミルク コーヒーメーカー・関連用品 かりた こーひーめーかーET-550TD  cf0346 9C1161 よろずやマルシェ　コーヒーメーカー　900ml 能　力 約60杯/h　デカンタ 1.85L 使用ロシ 立ロシ25cm 付属品 液晶サーモデカンターKTD-18 ファンネル井350・立ロシ25cm</font><br><style type="text/css">
